// SPDX-License-Identifier: GPL-3.0

pragma solidity >0.5.0 < 0.8.0;

contract looop{
    uint[4] public arra;
    uint public intt;

    function lopp() public{
        for (uint i=intt; i<arra.length; i++)
        {
            arra[intt]=intt;
            intt++;
        }
        }

}
